import React, { Component } from 'react'

export default class PropertyList extends Component {
    constructor(props) {
      super(props);

      this.state = {property: []};
    }

    componentDidMount() {
      this.PropertyList();
    }

    PropertyList() {
      $.getJSON('localhost:8000/api/v1/properties')
        .then(({ results }) => this.setState({ property: results }));
    }

    render() {
      const properties = this.state.property.map((item, i) => (
        <div>
          <h1>{ item.idProperty.first }</h1>
          <span>{ item.cell }, { item.propertyStatus }</span>
        </div>
      ));

      return (
        <div id="layout-content" className="layout-content-wrapper">
          <div className="panel-list">{ properties }</div>
        </div>
      );
    }
  }
